import React, { useState } from 'react';
import { Box, Button, Alert, TextField, InputAdornment, IconButton, CircularProgress } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';
import { useUserLoginMutation} from '../../services/authApi';
import {  storeAuthId, getAuthId, storeTempUserDetails } from '../../services/LocalStorage';

const UserLogin = () => {
  const [authid, setAuthId] = useState(getAuthId());
  const [error, setError] = useState({
    status: false,
    msg: '',
    type: '',
  });

  const [userLogin, { isLoading }] = useUserLoginMutation();
  const navigate = useNavigate();

  const emailRegex = /^\S+@(?!invalid\.com)([a-zA-Z0-9-]+\.)+[a-zA-Z]{2,6}$/;
  const passwordRegex = /^(?=.*[!@#$%^&*])(?=.*[a-zA-Z0-9]).{6,}$/;

  const [showPassword, setShowPassword] = useState(false);
  const handlePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData(e.currentTarget);
    const actualData = {
      email: data.get('email'),
      password: data.get('password'),
    };

    if (actualData.email && actualData.password !== null) {
      if (!emailRegex.test(actualData.email)) {
        setError({ status: true, msg: "Please enter a valid email address", type: 'error' });
        return;
      }
      if (!passwordRegex.test(actualData.password)) {
        setError({ status: true, msg: "Password must be at least 6 characters long and contain at least one special character.", type: 'error' });
        return;
      }

      try {
        const res = await userLogin(actualData).unwrap();
        console.log(res);

        if (res && res.status === 'success') {
          if (res.authid) {
            setAuthId(authid);
            storeAuthId(actualData.email);
            storeTempUserDetails(actualData);
            setTimeout(() => {
              navigate('/verifylogin');
              window.location.reload();
            }, 3000);
          } else {
            console.error('authid is not defined in the response:', res);
            setError({ status: true, msg: 'Error during registration: authid is missing', type: 'error' });
          } 
        } else if (res && res.status === 'failed') {
          setError({ status: true, msg: res.message, type: 'error' });
        } else {
          console.error('Unexpected response format:', res);
          setError({ status: true, msg: 'Unexpected response format', type: 'error' });
        }
      } catch (err) {
        console.error('Error during login:', err);
        setError({ status: true, msg: 'Login failed', type: 'error' });
      }
    } else {
      setError({ status: true, msg: 'All fields are required', type: 'error' });
    }
  };

  return (
    <>
      <h2 style={{ textAlign: 'center', color: 'navy' }}>Welcome!!!</h2>
      <Box
        component="form"
        noValidate
        sx={{
          mt: 1,
          p: 1,
          maxWidth: '400px',
          margin: 'auto',
        }}
        id="login-form"
        onSubmit={handleSubmit}
      >
        <TextField
          margin="normal"
          required
          fullWidth
          id="email"
          name="email"
          label="Email Address"
        />
        <TextField
          margin="normal"
          required
          fullWidth
          id="password"
          name="password"
          type={showPassword ? 'text' : 'password'}
          label="Password"
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <IconButton onClick={handlePasswordVisibility} edge="end">
                  {showPassword ? <VisibilityIcon /> : <VisibilityOffIcon />}
                </IconButton>
              </InputAdornment>
            ),
          }}
        />
        <Box sx={{ textAlign: 'center', mt: 1, color: 'white' }}>
          <Button
            type="submit"
            variant="contained"
            sx={{ mt: 3, px: 5, backgroundColor: 'white', color: 'navy', fontWeight: '550' }}
          >
            Login
          </Button>
          {isLoading && <CircularProgress />}
          {error.status && <Alert severity={error.type}>{error.msg}</Alert>}
        </Box>
      </Box>
    </>
  );
};

export default UserLogin;
